import React, { useEffect, useState } from "react";
import axiosInstance from "../../baseurl";

function Docchat() {
  const [allcustomers, setallcustomers] = useState([]);
  const [custname, setcustname] = useState([])
  useEffect(() => {
    axiosInstance
      .post(`/viewCustomersforDr/${localStorage.getItem("Doctorlogid")}`)
      .then((res) => {
        console.log(res, "View Customers for doc");
        if (res.data.data != undefined) {
         setallcustomers(res.data.data)
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  useEffect(() => {
    if(allcustomers.length){
      for( let i of allcustomers){
        axiosInstance.post(`/viewCustomerById/${i}`)
        .then((res)=>{console.log(res)
        setcustname([...custname, res.data.data])})
        .catch((err)=>{console.log(err);})
      }
    }
  });
  return (
    <div className="container-top">
      Docchat
      <div className="container">
        <div className="row">
          <div className="col">
            <h1> Customers</h1>
            <hr />
            {custname.length
              ? custname.map((a) => {
                  return <span key={a._id}> {a.name}</span>;
                })
              : null}
          </div>
          <div className="col"></div>
        </div>
      </div>
    </div>
  );
}

export default Docchat;
